import React from 'react';

const HeaderMenu = () => {
    return (
        <>
            <ul className='menu'>
                <li><a href='#home'>Home</a></li>
                <li><a href='#about'>About</a></li>
                <li><a href='#projects'>Projects</a></li>
                <li><a href='#contacts'>Contacts</a></li>
            </ul>
        </>
    );
};

export default HeaderMenu;
